{
  constructor(){
    super()
    this.state = {
      robots: robots,
      searchfield: ''
    }
  }

  onSearchChange = (event) => {
    console.log(event)
  }
  render() {
    return (
      <div className="tc">
        <header className="">
          <h1>Robofriends</h1>
        </header>
        <SearchBox />
        <CardList robots={this.state.robots} />
      </div>
    );
  }
}

export default App;
